import React, { useState } from "react"

export default function Find({listHouse, onSearch}) {
  const [searchHouses, setSearchHouses] = useState('')
  const [searchHouse, setSearchHouse] = useState('')

  const filterHouses = listHouse.filter(product=>
    product.name.toLowerCase().includes(searchHouses.toLowerCase())
  )

  function handleSearch(term) {
    setSearchHouses(term)
  }
  function handleSearch(e) {
    const value = e.target.value;
    setSearchHouses(value);
    onSearch(value)
  }

    return(
      <section className="find_section ">
      <div className="container">
        <form action="">
          <div className=" form-row">
            <div className="col-md-5">
              <input type="text" className="form-control" placeholder="Ищите своё будущее жилье " value={searchHouses} onChange={handleSearch}/>
            </div>
            <div className="col-md-5">
              <input type="text" className="form-control" placeholder="Локацыя(необязательна)"/>
            </div>
            <div className="col-md-2">
              <button type="submit" className="">
                искать
              </button>
            </div>
          </div>
  
        </form>
      </div>
    </section>
    )
}
